const Card = (props) => {
    return (
        <div className="pb-3 col-4 text-center px-0" >
            <div className="rounded-card shadow-lg pb-4 w-50" style={{overflow: "hidden"}}>
                <div className="card-img">
                    <img src={props.cardImage} className="w-100"/>
                </div>
                <div className="card-custom-body">
                    <h4 className="title text-muted">islam saeed</h4>
                </div>
            </div>
        </div>
    )
};


export default Card;
